Discover the adventures of heroes and monsters that exist in the world of mythical and magical creatures!
Stories have been told on every continent since the dawn of time, and some have lasted for thousands of years, becoming what we know today as myths. These fantastical tales educate and fascinate by creating amazing worlds and inhabiting them with wondrous feats of heroics and dastardly deeds of evil. Children's Book of Mythical Beasts &amp; Magical Monsters gives children the opportunity to discover these stories, and encourages them to understand storytelling from different cultures.
